import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
function Userprofile(){
    const username = 'Bob';
    return(
        <div className="page-wrap d-flex flex-row align-items-center">
            <div className="container py-5">
                <h3>Welcome, {username}</h3>
            </div>
        </div>

    );
}
export { Userprofile };
